import './Cart.css';


function InCourse({cs}: any ){


  return <div>
    <div className = 'courseHead' >
    <div className = 'courseID'>
      {cs.dept} {' '} {cs.number}
    </div>
    <div className = 'title'> {cs.title} </div>
    </div>
  </div>;
}

function Cart({acs}: any){


 return( <div className = 'cart' >
    <h4>Course Cart</h4>

    <p>Your cart is currently empty!</p>

    {acs.map((value : any) => (

<InCourse cs = {value} />

))}
  </div>);
}

export default Cart;
